pragma solidity ^0.7.6;

contract bank{
    int bal=0;

    function deposite_money(int amt) public{
        bal+=amt;
    }

    function withdraw(int amt) public{
        bal-=amt;
    }

    function getBalance() public returns(int) {
        return bal;
    }
}

